;13.7100000000000;13.6140000000000;13.5210000000000;13.4300000000000;13.3430000000000;13.2590000000000;13.1780000000000;13.1000000000000;13.0250000000000;12.9530000000000;12.8850000000000;12.8200000000000;12.7580000000000;12.7000000000000;12.6460000000000;12.5950000000000;12.5470000000000;12.5030000000000;12.4630000000000;12.4270000000000;12.3940000000000;12.3650000000000;12.3400000000000;12.3180000000000;12.3010000000000;12.2870000000000;12.2770000000000;12.2710000000000;12.2690000000000;12.2710000000000;12.2770000000000;12.2860000000000;12.3000000000000;12.3170000000000;12.3380000000000;12.3630000000000;12.3920000000000;12.4240000000000;12.4600000000000;12.5000000000000;12.5440000000000;12.5910000000000;12.6420000000000;12.6960000000000;12.7540000000000;12.8160000000000;12.8800000000000;12.9480000000000;13.0200000000000;13.0940000000000;13.1720000000000;13.2530000000000;13.3370000000000;13.4240000000000;13.5140000000000;13.6070000000000];
% % run the clear-sky detection routine.
% csd = RuizArias2018CSD(ghi,dif,zen,1); %plot figure set to 1 so an output is plotted
%
function csd =RuizArias2018CSD(ghi,dif,zen,plot_figure)
% safety checks
if ~iscolumn(ghi)
    ghi = ghi';
    if ~iscolumn(ghi)
        error('var ghi must be a column vector')
    end
end
if ~iscolumn(dif)
    dif = dif';
    if ~iscolumn(dif)
        error('var dif must be a column vector')
    end
end
if ~iscolumn(zen)
    zen = zen';
    if ~iscolumn(zen)
        error('var zen must be a column vector')
    end
end
if length(unique([length(ghi),length(dif),length(zen)]))~=1
    error('vars must be equal in length')
end

% definitions needed
dt = 1;
min_cs_points = 5;
max_iter = 10;
max_sza = 85;

csza = cosd(zen);
idxs = find(abs([NaN;diff(1365.*csza)])<0.05);
% there are possibly multiple periods <0.05, and so we we want to isolate
% them. They will be all consecutively indexed, and so we can remove any
% diff that is consecutive. e.g. ==1;
didxs = [0;diff(idxs)];
idxs(didxs==1)=[];
solar_noons = csza(idxs);
% find the nearest solar noon. 
nearest_noon = knnsearch(idxs, (1:length(ghi))');
csza_at_noon = solar_noons(nearest_noon);
% there is often a lot of noise at solar noon, particularly with
% non-continuous data, as such, we find those noisy periods and replace
% them with the nearest non noisy period.
% it is never just 1 point, always a range.
csza_at_noon(csza_at_noon<prctile(csza_at_noon,1))=prctile(csza_at_noon,1);

% Global thresholds
SC = 1365; % Solar constant, W/m2
% DT = 1. % temporal resolution of the data, minutes
MAX_DIFFERENCE = 1E-5;

% 1. Normalized Total Shortwave Magnitude Test
TEST1_LOW_SUN_THRES = cosd(78.5);
TEST1_MAX_INI_GHI = 1350; %1250. % max allowed limit for norm_ghi
TEST1_MIN_INI_GHI_WITH_LOW_SUN = 800; %900. % min allowed limit for norm_ghi
TEST1_MIN_INI_GHI_WITH_HIGH_SUN = 900; %1000.
TEST1_INI_COEF_B = 1.2; % exponent coefficient in Eq. (1)
TEST1_UPPER_GHI_MARGIN = 150;
TEST1_LOWER_GHI_MARGIN = 150;

% 2. Maximum Diffuse Shortwave Test
test2_max_dif = 150; % Eq (2) % diffuse based on clima parameters, Eq. (2)
test2_coef_b = 0.5; % Eq (2)

% 3. Change in Magnitude with Time Test
% TEST3_C = 2;  % W/m2, Eq (4)

% 4. Normalized Diffuse Ratio Variability Test
TEST4_INI_COEF_B = -0.8; % coefficient b in Eq (6)
test4_max_sd = 0.0012; % 11-min running std of norm dif ratio

min_cosz = cosd(max_sza);

% zen at noon.
mu0 = nanmax([ones(size(csza)).*1e-4,csza],[],2);
mu0_at_noon = nanmax([ones(size(csza)).*1e-4,csza_at_noon],[],2);
glo = nanmax([ones(size(ghi)).*1e-4,ghi],[],2);
kd = nanmax([ones(size(ghi)).*1e-4,dif./glo],[],2);

test0 = ones(size(ghi));
test1 = ones(size(ghi));
test2 = ones(size(ghi));
test3 = ones(size(ghi));
test4 = ones(size(ghi));

% remove too small zeniths or missing data.
test0(mu0<min_cosz)=0;
test1(isnan(ghi) | isnan(dif)) = 0;
test2(isnan(ghi) | isnan(dif)) = 0;
test3(isnan(ghi) | isnan(dif)) = 0;
test4(isnan(ghi) | isnan(dif)) = 0;


%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%
% FIRST LOOP THROUGHOUT DATA TO FLAG CLOUD OBSERVATIONS AND
% FIND FIRST GUESS ESTIMATES FOR PARAMETERS OF TESTS 2 AND 4
%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%
test1_coef_b = TEST1_INI_COEF_B;
test4_coef_b = TEST4_INI_COEF_B;

% normalized diffuse ratio (it has to be computed here)
norm_dif_ratio = kd./(mu0.^test4_coef_b);

% 1. Normalized Total Shortwave Magnitude Test
norm_ghi = glo./(mu0.^test1_coef_b);
test1_max_allowed_ghi = ones(size(ghi)).*TEST1_MAX_INI_GHI;
test1_min_allowed_ghi =  ones(size(ghi)).*TEST1_MIN_INI_GHI_WITH_LOW_SUN;
test1_min_allowed_ghi(mu0<TEST1_LOW_SUN_THRES)=TEST1_MIN_INI_GHI_WITH_HIGH_SUN;
test1((norm_ghi > test1_max_allowed_ghi) | (norm_ghi < test1_min_allowed_ghi))=0;

% 2. Maximum Diffuse Shortwave Test
test2_dif = test2_max_dif .* (mu0.^test2_coef_b);
test2(dif > test2_dif)=0;

% 3. Change in Magnitude with Time Test
dif_mu0 = [NaN;diff(mu0)];
dif_glo = [NaN;diff(glo)];
Delta_Ftoa = SC.*abs((dif_mu0)./(2.*dt));% time variability at TOA
Delta_Gsfc = abs(dif_glo./(2.*dt));% time variability of input GHI
 % min/max allowed time variability of GHI
test3_max_allowed_var = Delta_Ftoa + 2.* mu0;
test3_min_allowed_var = Delta_Ftoa - (dt.*(0.1 + mu0_at_noon) ./ mu0);
test3((Delta_Gsfc > test3_max_allowed_var) | (Delta_Gsfc < test3_min_allowed_var))=0;

% 4. Normalized Diffuse Ratio Variability Test
test4_win_sz = 11;
test4_dat = hankel(norm_dif_ratio,[norm_dif_ratio(end),NaN(1,test4_win_sz-1)]);
test4_running_mn = nanmean(test4_dat,2);
test4_running_sd = sqrt(nansum((test4_dat-test4_running_mn).^2,2)./test4_win_sz);
test4(test4_running_sd > test4_max_sd)=0;

% define the csflag
csflag = zeros(size(ghi));
% apply the tests.
csflag((test0 + test2 + test3 + test4)==4)=1;
% apply the constraints.
csflag(mu0<min_cosz)=0;
csflag(isnan(ghi) & isnan(dif)) = 0;
n_cs_points = sum(csflag);

%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%
% HERE CSFLAG REPRESENTS THE BEST GUESS FROM FIRST PARAMETERISATION.
%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%

% Because we can now discretise the zenith and ghi by suspected clear sky,
% we can begin to optimise the a and b ceofficients.

% update clear-sky thresholds for test 1.
log_x = log10(mu0(csflag==1));
log_y = log10(glo(csflag==1));
mean_x = nanmean(log_x);
mean_y = nanmean(log_y);
mean_xx = nanmean(log_x.^2);
mean_xy = nanmean(log_y.*log_x);
coef_b = (mean_xy - mean_x .* mean_y) ./ (mean_xx - mean_x.^2);
coef_a = exp(mean_y - coef_b.*mean_x);
test1_max_allowed_ghi = coef_a + TEST1_UPPER_GHI_MARGIN;
test1_min_allowed_ghi = coef_a - TEST1_LOWER_GHI_MARGIN;
test1_coef_b = coef_b;

% update clear-sky thresholds for test 4.
log_x = log10(mu0(csflag==1));
log_y = log10(kd(csflag==1));
mean_x = nanmean(log_x);
mean_y = nanmean(log_y);
mean_xx = nanmean(log_x.^2);
mean_xy = nanmean(log_y.*log_x);
coef_b = (mean_xy - mean_x .* mean_y) ./ (mean_xx - mean_x.^2);
difference = abs(coef_b - test4_coef_b);
test4_coef_b = coef_b;

% normalized diffuse ratio (it has to be computed here)
norm_dif_ratio = kd./(mu0.^test4_coef_b);

n_iters = 0;
%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%
%             ITERATIVE OPTIMISATION PROCEDURE
%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%
while ((n_cs_points > min_cs_points) && (difference > MAX_DIFFERENCE) && (n_iters < max_iter))
    
    % 1. Normalized Total Shortwave Magnitude Test
    norm_ghi = glo./mu0.^test1_coef_b;
    test1((norm_ghi > test1_max_allowed_ghi) | (norm_ghi < test1_min_allowed_ghi))=0;
    
    % 4. Normalized Diffuse Ratio Variability Test
    test4_win_sz = 11;
    test4_dat = hankel(norm_dif_ratio,[norm_dif_ratio(end),NaN(1,test4_win_sz-1)]);
    test4_running_mn = nanmean(test4_dat,2);
    test4_running_sd = sqrt(nansum((test4_dat-test4_running_mn).^2)./test4_win_sz);
    test4(test4_running_sd > test4_max_sd)=0;
    
    % apply the tests.
    % as the tests are updated, csflag can be reevaluated, however, needs
    % to be reinitialised also have incorrect csd from last iter.
    csflag = zeros(size(ghi));
    csflag((test0 + test2 + test3 + test4)==4)=1;
    % apply the constraints.
    csflag(mu0<min_cosz)=0;
    csflag(isnan(ghi) & isnan(dif)) = 0;
    
    n_cs_points = sum(csflag);
    
    % update clear-sky thresholds for test 1.
    log_x = log10(mu0(csflag==1));
    log_y = log10(glo(csflag==1));
    mean_x = nanmean(log_x);
    mean_y = nanmean(log_y);
    mean_xx = nanmean(log_x.^2);
    mean_xy = nanmean(log_y.*log_x);
    coef_b = (mean_xy - mean_x .* mean_y) ./ (mean_xx - mean_x.^2);
    coef_a = exp(mean_y - coef_b.*mean_x);    
    % update clear-sky thresholds for test 1
    % NOTE: In the last iteration must be +100 and -100.
    test1_max_allowed_ghi = coef_a + TEST1_UPPER_GHI_MARGIN;
    test1_min_allowed_ghi = coef_a - TEST1_LOWER_GHI_MARGIN;
    test1_coef_b = coef_b;
    
    % update clear-sky thresholds for test4.
    log_x = log10(mu0(csflag==1));
    log_y = log10(kd(csflag==1));
    mean_x = nanmean(log_x);
    mean_y = nanmean(log_y);
    mean_xx = nanmean(log_x.^2);
    mean_xy = nanmean(log_y.*log_x);
    coef_b = (mean_xy - mean_x .* mean_y) ./ (mean_xx - mean_x.^2);
    difference = abs(coef_b - test4_coef_b);
    test4_coef_b = coef_b;
    
    % normalized diffuse ratio (it has to be computed here)
    norm_dif_ratio = kd ./ (mu0.^test4_coef_b);
    
    n_iters = n_iters + 1;
    
    % if difference is smaller or equal than MAX_DIFFERENCE the
    % iteration is over and a last threshold of +-100 has to
    % be applied in test1
    if (difference <= MAX_DIFFERENCE)
        test1_max_allowed_ghi = test1_max_allowed_ghi - 50;
        test1_min_allowed_ghi = test1_min_allowed_ghi + 50;
    end
    
    % 1. Normalized Total Shortwave Magnitude Test
    norm_ghi = glo./mu0.^test1_coef_b;
    test1((norm_ghi > test1_max_allowed_ghi) | (norm_ghi < test1_min_allowed_ghi))=0;
    
    
    % apply the tests.
    % as the tests are updated, csflag can be reevaluated, however, needs
    % to be reinitialised also have incorrect csd from last iter.
    csflag = zeros(size(ghi));
    csflag((test0 + test2 + test3 + test4)==4)=1;
    % apply the constraints.
    csflag(mu0<min_cosz)=0;
    csflag(isnan(ghi) & isnan(dif)) = 0;
    
    n_cs_points = sum(csflag);
end

csd = zeros(size(ghi));
csd(csflag==0)=1;

%% figure
if exist('plot_figure','var')
    figure('name','Ruiz Arias 2018 example','color','w');
    hold on
    plot(ghi)
    CSD = ghi;
    CSD(csd==1)=NaN;
    plot(CSD,'linewidth',2,'color','k')
    hold off
    legend('GHI','Clear detected')
    ylabel(gca,'Irradiance [Wm^{-2}]')
    set(gca,'xtick',[]);
    xlabel('Time')
end

end
